Defendant Kodiak D Young in court with attorney Richard J. Carpenter.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Sentencing proceeded. PSI gone over; additions/corrections made. Statements by the State, defense counsel and defendant.  Additional statements by:  Ms. Alyssa W.   The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years consecutive to 14CF000471.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years with credit for 6 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION.  The defendant is  eligible for the Challenge Incarceration Program and for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years, CONCURRENT to probation in 14CF471. Court approved participation in the Dosage Probation Pilot Program and early termination of probation if defendant successfully completes program and all other conditions of probation. Dosage Probation Card provided to defendant.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - Serve 8 months condition time at the House of Correction, with release only to the Day Reporting Center; good time allowed.  Court stayed report date to:  9/15/14 at 5:00 p.m.  
 - No contact with Jama D., Alyssa W., or James T., or their families or residences;
 - No controlled substances or alcohol;
 - Urine screens;
 - AODA assessment and treatment;
 - Be given literacy training;
 - Obtain GED;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay stipulated restitution to Alyssa W. in the amount of $2,200.00 and $57.02 to James T.; pay DNA surcharge, fine, costs, fees, and assessments.  Should defendant get revoked and be sent to prison, the Court ordered monies taken from prison funds not to exceed 25% to be collected by the DOC.  Balance would be paid while on extended supervision.  Failure to pay amounts in full would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.

Filed,
